import React, { useState, useEffect } from 'react';
import './App.css';

export default function App() {

    const [objectArray, setObjectArray] = useState([]);

    useEffect(() => {
      // Generate an array of 10 objects with unique IDs
      const newArray = Array.from({ length: 10 }, (_, index) => ({
        id: `object${index + 1}`, // Generate unique IDs
        // You can add more properties to your objects if needed
        // Example:
        // otherProperty: 'Some value'
      }));
      setObjectArray(objectArray);
    }, []); // Empty dependency array means this runs once on page load



    console.log(objectArray);

    return (
        <div>
          <h2>Generated Objects:</h2>
          <ul>
            {objectArray.map((object) => (
              <li key={object.id}>{JSON.stringify(object)}</li>
            ))}
          </ul>
        </div>
      );
}
